/*!40000 ALTER TABLE `info` DISABLE KEYS */;
INSERT INTO `info` VALUES ('r',1,'\"태아가 적혈구를 만드는 시기이므로 임신부의 충분한 철분섭취가 필수적입니다. 기름기가 없는 살코기, 생선, 콩류, 시금치, 철분이 보충된 시리얼 등이 철분이 함유된 식품입니다.\"','B21','B21','baby'),('r',2,'\"아기의 청력 발달이 거의 완성 되었습니다. 이제 밖에서 들리는 소리와 리듬에 반응을 보이는 태아를 위해 엄마나 아빠가 읽어주는 동시는 좋은 태교 방법입니다. 엄마 아빠의 목소리, 그 속에 담긴 리듬감이 이제 몸의 발달에서 점차 뇌의 발달로 집중되는 아기에게는 더 없이 좋은 뇌 자극법일 수 있습니다.\"','B27','B27','baby'),('r',3,'탯줄의 혈액을 냉동 보관 하였다가 후에 만에 하나 생길지도 모르는 아기의 질병에 대비하는 제대혈 은행이라는 제도가 있다고 합니다. 신생아 탯줄에서 뽑아낸 혈액(제대혈 조혈세포)이 암과 백혈병 등의 불치병을 치료할 수 있는 소중한 자원이 될 수 있다고 합니다. 의사 선생님이나 관련 단체에 문의해보세요.','B27','B27','baby'),('r',4,'\"28주 째에는 담당 의사에게 태아의 위치를 확인 받아, 반드시 머리에서 손가락 끝 방향으로 어루만지면서 배를 마사지합니다. 이 방향의 자극이 뇌에서 몸 전체로 연결되어 있는 신경의 발육을 촉진시킵니다. 단, 배가 수축하는 느낌을 받는다면 바로 중단하시고 휴식을 취해주세요.\"','B28','B28','baby'),('r',5,'\"특히 8개월 전후로 태아의 뇌가 더 활발하게 성장합니다. 이때쯤 불룩 솟은 배에 두 손을 감싸안듯이 얹어 놓은 채로 가만히 있거나, 배를 조심스럽게 두드려보거나 쓸어보거나 흔들어보면 뇌 성장에 도움이 됩니다.\"','B31','B31','baby'),('r',6,'\"아기가 정상적인 위치로 있는지, 거꾸로 있지는 않는지 확인하세요. 대체로 아기는 임신후기가 되면 머리를 아래로 향하고 있지만 간혹 거꾸로 있는 아기도 있습니다. 거꾸로 있는 역아일 때는 의사와 상의하세요. 역아를 돌리는 운동을 할 때는 의사와 상의하세요.\"','B31','B31','baby'),('r',7,'\"이제 아기를 낳아 모유를 먹일 것인지 분유를 먹일 것인지 결정해야 합니다. 모유와 분유의 장단점, 엄마의육아상황 등에 따라 결정해야 할 것입니다. 그리고 모유 수유와 분유 수유에 따라 각각 필요한 수유용품도 미리준비하세요.\"','B31','B31','baby'),('r',8,'태어나서 돌 무렵까지는 아기의 욕구를 충족시켜 정서적으로 안정되게 해야 합니다.','A1','A0','baby'),('r',9,'애정이 듬뿍 담긴 손길로 아기에게 엄마의 사랑을 확신있게 심어주어야 합니다.','A1','A0','baby'),('r',10,'젖을 먹일 때는 반드시 꼭 껴안고 먹여주어야 합니다. 엄마의 젖을 빨면서 아기는 꼭 엄마의 눈을자기 눈에다 맞춥니다. 엄마의 얼굴을 쳐다보면서 젖 빠는 행위가 되풀이되어 진행되는 동안 아기는 엄마의 사랑을 느끼게 되고 \'너\'와 \'나\'라는 상호 관계를 깨닫게 되어 사회성이 발달합니다.','A1','A0','baby'),('r',11,'사랑이 듬뿍 담긴 목소리로 아기의 이름을 자주 불러주어야 합니다. 아기의 이름을 자주 불러주면서 자장가 등을 들려주는 일은 아기로 하여금 정서적으로 평온함을 갖게하는 동시에 가족관계도 익히게 만들어 사회성도 아울러 발달시켜 줍니다.','A1','A0','baby'),('r',12,'\"신생아들은 체온을 조절하는 기능이 미숙하기 때문에 방 안의 온도에 신경을 써주어야 합니다. 아기의 목 뒷부분에 살며시 손을 대보아 땀으로 젖어있다면 아기는 덥다고 말하는 중입니다. 아기 방의 최적 온도는 22~26°C 정도이고, 적당한 습도는 50~60% 정도입니다. 또한 더운 여름철에는 강한 바람이나 선풍기 바람을 직접 쐬게 되면 체온이 저하될 위험이 있기 때문에 간접적인 통풍이 적당합니다.\"','A1','A0','baby'),('r',13,'아기가 건강하게 자랄 수 있도록 의사 선생님을 규칙적으로 찾아가는 일이 필요합니다. 아기가 세상에 태어나 만 1개월이 되면 소아과 의사의 건강진단을 받아봅니다.','A2','A1','baby'),('r',14,'손가락 자극은 두뇌 발달로 이어지니 손을 맘껏 움직일 수 있는 시간을 많이 갖는게 좋아요. ','A7','A6','baby'),('r',15,'많이 기어다녀야 다리와 허리 근육이 튼튼해져서 다음 발달에 힘이 돼요. 잘 움직여보도록 안전한 환경을 만들어주세요.','A7','A6','baby'),('r',16,'아기가 심심해 하지는 않나요? 낮에 다 같이 산책을 나가면 아이의 뇌 내 신경망에 좋은 자극을 줄 수 있어요.','A7','A6','baby'),('r',17,'보행기는 스스로 꼿꼿이 설 수 있는 아기들이 사용해야 해요. 그렇다고 너무 오래 사용하면 척추에 무리가 갈 수 있으니 엄마 아빠의 지도가 필요해요.','A8','A7','baby'),('r',18,'아기도 스트레스를 받고 그럴 때 크게 울 수 있어요. 하지만 그렇다고 과잉보호는 금물이에요. 아기가 스트레스를 잘 풀수 있도록 관심을 돌릴 만한 장난감과 놀이를 준비해주세요.','A12','A7','baby'),('p',19,'\"아기의 탄생, 그 맨 처음 시작은 수정 정자와 난자가 나팔관에서 만나 수정이 되는 순간에 새 생명이 시작됩니다. 수정란의 크기는 직경 0.2mm 정도. 수정란은 수정된 지 12~15시간이 지나면 세포 분열을 하기 시작합니다.\"','B3','B3','baby'),('p',20,'나팔관을 따라 이동한 수정란이 자궁내막에 착상하여 세포 분열을 반복하는 시기입니다.','B4','B4','baby'),('p',21,'\"이 시기가 되면 초음파로 임신을 확인할 수 있습니다. 초음파를 통해 임신낭이 보이며, 심장, 간장, 위 등의 장기가 형성되기 시작하는 시기입니다.\"','B5','B5','baby'),('p',22,'초음파로 태아의 심장박동이 뛰는 것을 볼 수 있습니다. 뇌와 척수의 신경세포 80%가 이 시기에 만들어집니다. 엄마와 태아를 연결하는 태반과 탯줄도 점점 발달하여 초음파를 통해 태아의 심장박동이 뛰는 것을 확인할 수 있습니다.','B6','B6','baby'),('p',23,'\"사람의 형태를 갖춘 2등신이 됩니다. 머리가 몸 전체의 반 정도를 차지하며 머리와 몸통 구별이 가능해집니다. 마치 물고기처럼 보이던 모양에서 이제 사람의 형태를 갖춘 2등신으로 변하게 됩니다. 머리, 몸체, 팔, 다리 형태가 구별되며 뇌는 급속도로 발달하기 시작합니다.\"','B7','B7','baby'),('p',24,'\"뇌와 신경세포의 80%가 이 시기에 분화되고 손가락, 발가락이 생기고 아주 희미하긴 하지만 눈, 코, 귀, 입 등도 커집니다. 초음파를 통해 성별의 확인은 불가능하지만, 난소와 고환이 될 조직도 나타납니다. 양수가 생기기 시작하며 태아의 키는 2cm, 체중은 약 4g 정도가 됩니다.\"','B7','B7','baby'),('p',25,'\"사람의 형태를 갖춘 2등신이 됩니다. 손가락, 발가락이 생기며 눈과 귀의 시신경, 청각신경이 발달합니다. 내장 기관도 형태를 보이기 시작하고 태반이 발달하기 시작하며 탯줄이 될 조직도 생깁니다. 태아의 원시적인 움직임이 시작되어 몸놀림을 관찰할 수 있습니다.\"','B8','B8','baby'),('p',26,'\"얼굴 윤곽이 차츰 잡혀갑니다. 이 시기에는 몸통과 팔, 다리의 발달이 두드러지고 얼굴 윤곽이 확실해집니다. 귀가 발달하기 시작하고 치아 돌기가 형성되며. 피부가 두 개 층으로 분화하기 시작하기 시작합니다. 태아는 몸 전체를 굼실굼실하면서 양수 안에서 헤엄을 칩니다.\"','B9','B9','baby'),('p',27,'\"물고기의 꼬리 같은 부분이 점차 없어지며 몸은 곧게 펴지고 길어집니다. 손가락, 발가락 5개가 분명히 보이고 얼굴 피부밑으로 눈두덩, 입술, 아래턱, 뺨도 발달하기 시작하여 기초적인 안면 골격이 나타납니다. 귀는 내이와 외이로 분화되며 눈꺼풀도 생깁니다. 약간의 색소가 안구에 모이며 콧구멍의 모습도 초음파로 보이기 시작합니다.\"','B10','B10','baby'),('p',28,'\"태아가 신체상으로 거의 4배 성장을 합니다. 키는 약 5~9cm, 체중은 약 20g이 됩니다. 모낭 속의 체모가 자라나 솜털이 생기고 모든 체내 기관이 발달하여 심장, 간, 비장, 맹장, 내장이 발달합니다. 내장은 원형의 고리를 만들 정도로 길게 형성되고 순환기관도 자리를 잡게 됩니다.\"','B11','B11','baby'),('p',29,'\"초음파 도플러 태아 심박검출장치로 태아의 심음을 들을 수 있습니다. 대부분 근육조직이 형태를 갖추기 시작하고 사지가 확실히 구별, 길이도 길어져 손목과 손가락이 나타납니다. 다리도 허벅지, 종아리, 발로 분화되고 성기도 형성되기 시작합니다.\"','B11','B11','baby'),('p',30,'태아의 얼굴과 몸에 배내털로 불리는 솜털이 나서 덮이기 시작합니다. 뇌가 급속도로 발달하고 머리는 다른 부분에 비교해 상당히 커서 탁구공만 한 크기로 전신의 ⅓ 정도를 차지합니다. 아직 뇌의 표면은 매끄럽고 주름이 잡혀있지 않습니다. 근육과 뼈가 발달하고 턱에는 32개의 영구치가 될 뿌리가 들어있습니다.','B12','B12','baby'),('p',31,'이 시기가 되면 투명하게 보이던 피부가 점차 살이 오르고 심장박동이 힘차 얼굴에 붉은 기운이 감돌게 됩니다.','B13','B13','baby'),('p',32,'눈꺼풀은 아직 내리 덮인 채로 형태가 잡히는 중이지만 눈은 거의 형태를 갖추고 두 눈이 콧등 주변으로 모이기 시작합니다. 그러나 아직 서로 멀리 떨어져 있습니다. ','B13','B13','baby'),('p',33,'목이 생기고 어른 턱밑 군살처럼 생겼던 바깥귀가 점차 목 윗부분으로 올라가게 됩니다. 이 때가 되면 양수의 양도 늘어납니다.','B13','B13','baby'),('p',34,'생식기가 외부로 드러나기 시작합니다. 임신 14주가 되면 태반이 거의 완성되어 엄마의 자궁에 뿌리를 내리게 됩니다. 이 시기의 태아는 피부가 두꺼워지며 불투명하게 되어 내장을 보호하게 됩니다. ','B14','B14','baby'),('p',35,'\"앞으로 굽었던 자세에서 점차로 등을 펴게 되며 최초의 뼈 조직과 갈비뼈가 나타나게 됩니다. 목이 굵어지고 머리도 커지면서 점점 발달하게 됩니다. 팔, 다리에 관절이 생기고 태아 몸이 점점 더 단단해집니다.\"','B14','B14','baby'),('p',36,'\"키는 4주 전보다 두 배로 늘고 체중은 6배로 늘어 16~18cm, 120g 정도가 됩니다. 신장이 형성되어 양수로 소변을 내보내기 시작합니다. 가끔 양수를 마시고 뱉기도 합니다. \"','B15','B15','baby'),('p',37,'목 근처에 있던 폐와 심장이 가슴으로 내려가는 등 내장 기관이 제대로 자리를 잡으며 훨씬 사람다워집니다. 머리가 탁구공만 하고 두개골 안에 뇌가 가득 찹니다. ','B15','B15','baby'),('p',38,'\"불완전하지만 뇌가 발달하며 외부 자극에 대해 쾌감과 불쾌감, 불안, 초조 등의 기본적인 감정을 느끼기도 합니다.\"','B15','B15','baby'),('p',39,'배가 불러오는 것을 임신부 스스로가 느낄 만큼 태아가 급성장합니다. ','B16','B16','baby'),('p',40,'\"이 시기의 태아의 피부는 지방이 증가하여 불투명하지만, 아직은 빨간빛을 띠고 있습니다.\"','B16','B16','baby'),('p',41,'양수 속에서 태아의 움직임이 활발해져 머리를 도리도리 흔들거나 손발을 따로 움직입니다.','B16','B16','baby'),('p',42,'내이가 완성되어 자궁 밖에서 나는 소리도 태아가 직접 들을 수 있습니다. 신장이나 방광도 거의 완성됩니다.','B16','B16','baby'),('p',43,'아직 눈꺼풀은 덮여 있는 상태지만 망막은 빛의 자극에 반응하기 시작합니다.','B17','B17','baby'),('p',44,'단맛과 쓴맛을 구분하게 되고 조용한 음악을 들으면 안정된 모습을 보이고 요란한 소리가 들리면 불안해하기도 합니다.','B17','B17','baby'),('p',45,'\"피부가 튼튼해지고 낡은 세포가 벗겨지는 변화가 시작됩니다. 눈썹, 속눈썹, 머리털이 자라고 손톱, 발톱도 생겨나고 지문도 생깁니다.\"','B17','B17','baby'),('p',46,'이 시기가 되면 태아는 표정을 짓기 시작해 눈동자를 움직이고 이마를 찡그리거나 울상을 짓기도 합니다. ','B17','B17','baby'),('p',47,'\"원시적이긴 하지만 신경계통의 발달이 두드러져 촉각, 미각, 청각이 뚜렷해집니다. \"','B18','B18','baby'),('p',48,'움직임이 빨라져 발길질을 하기도 합니다. 다리가 팔보다 길고 다리는 부위마다 적절한 비율로 발달합니다.','B18','B18','baby'),('p',49,'양수 속에서의 태아의 움직임이 더욱 활발해져 팔을 구부렸다 펴기도 하며 발길질을 하기도 하고 때때로 엄마에게 이런 움직임이 감지되기도 합니다.','B18','B18','baby'),('p',50,'태아는 태어나자마자 엄마의 젖꼭지를 빨기 위한 연습으로 입에 닿는 것을 반사적으로 빨기도 합니다.','B18','B18','baby'),('p',51,'\"기억력을 담당하는 뇌의 발달로 엄마의 목소리를 기억합니다. 숫자상으로 거의 어른에 육박할 정도로 신경세포가 발달합니다. 머릿속 간뇌가 발달해 탯줄을 타고 전해지는 엄마의 감정 변화에 따라 반응을 하게 됩니다. 기억력을 담당하는 뇌의 발달로 자주 듣는 엄마, 아빠의 목소리를 기억하게 됩니다.\"','B19','B19','baby'),('p',52,'처음엔 뱃속에서 물방울이 보글거리는 듯한 움직임을 느끼는 것을 시작으로 하루하루 힘찬 태동을 감지해갑니다. 그러나 개인차가 있어 초산부의 경우 20주 이후에 태동을 느끼기도 합니다. ','B19','B19','baby'),('p',53,'\"태아의 키는 약 25cm, 체중은 약 300g이 됩니다. 머리둘레는 4.5cm까지 자라 머리가 몸 전체의 ⅓ 정도가 됩니다. 심장박동이 강해져 청진기로 태아의 심음을 들을 수 있습니다.\"','B19','B19','baby'),('p',54,'태동이 확실해집니다. 양수의 양이 늘어나 자유롭게 움직이므로 위치가 자주 변하며 태동이 확실해집니다.','B20','B20','baby'),('p',55,'태아의 몸놀림이 활발해지면서 임신부의 배가 쿡쿡 쑤시기도 합니다. ','B20','B20','baby'),('p',56,'피부표면에 피지선에서 분비되는 태지가 보이기 시작하는데 태지는 분만 시 산도를 부드럽게 통과할 수 있는 윤활유 역할을 합니다.','B20','B20','baby'),('p',57,'뇌에 주름이 생기기 시작합니다.','B20','B20','baby'),('p',58,'\"아기는 계속해서 몸무게가 늘어나고 있고, 하얗고 미끌 거리는 태지에 싸여 있습니다. 아기는 오랫동안 양수 속에 있어야 하는데 태기는 이러한 아기의 피부를 보호하기 위한 것입니다. 일부의 아기는 태지에 싸여 출산할 수도 있습니다.\"','B21','B21','baby'),('p',59,'아기 뇌의 간뇌가 발달하면서 태아는 엄마의 희로애락에 영향을 받습니다. 예비 엄마와 아빠의 불협화음은 자연 태아를 불안하게 만들어 안정되지 못한 성격의 아기로 만들 수 있습니다.','B21','B21','baby'),('p',60,'임신 20주에 접어들면 냄새를 맡아 뇌를 전달하는 기관이 만들어지고 이 기관에서 보내는 냄새의 신호를 판독하는 뇌도 상당히 발달해서 태아는 어떤 냄새든 맡을 수 있습니다. 물론 바깥 세상의 냄새를 맡는 것은 아니고 항상 같이 호흡하는 엄마의 냄새를 맡는 것입니다.','B21','B21','baby'),('p',61,'엄마가 좋은 향기를 맡고 기분이 좋아지면 뇌에서 건강한 호르몬이 흐르게 되고 그때 나온 호르몬은 태반을 통해서 태아의 뇌에 전해져 태아도 기분이 좋아집니다.','B21','B21','baby'),('p',62,'\"눈썹과 눈꺼풀이 완전해지고, 손가락의 손톱도 앙증맞게 자라고 있습니다. 하지만 아직 피부 밑의 지방이 부족하여 피부가 쭈글쭈글합니다.\"','B22','B22','baby'),('p',63,'\"아기의 청력이 한결 발달하였습니다. 그러므로 엄마는 더욱 말을 조심하고, 동요를 불러주거나 더 많은 음악을 들려주어 아기 정서발달에 도움을 주는 것이 좋습니다. 마음이 따뜻해지는 동화를 읽는 것도 좋은 방법입니다. 아기가 엄마로부터 나오는 소리, 엄마 주변의 모든 소리를 듣고 있다고 생각하세요.\"','B22','B22','baby'),('p',64,'아기는 이제 완전히 자신의 모습을 찾았습니다. 신경섬유가 연결되고 근육이 발달하면서 움직임이 좀 더 강해졌습니다.','B23','B23','baby'),('p',65,'\"입술 모양도 뚜렷해지고, 색소를 띠지는 않았지만 눈도 발달했습니다. 눈썹과 눈꺼풀도 제자리를 찾았습니다. 그러나 크기는 아직 작아 키 25~30cm, 몸무게는 0.5~0.6kg 정도입니다.\"','B23','B23','baby'),('p',66,'\"몸에 필요한 호르몬을 만드는 췌장도 발달하고 있습니다. 이제 치아가 만들어질 준비작업의 하나로, 잇몸 밑부분에서 치아의 뿌리가 나타납니다.\"','B23','B23','baby'),('p',67,'폐 속의 혈관은 후에 아기가 폐로 숨을 쉴 수 있도록 준비운동을 하고 있습니다.','B24','B24','baby'),('p',68,'태아의 뇌에 주름이 잡히면서 뇌가 활동을 시작합니다. 말단 신경세포로부터 정보를 받아들이는 일을 하는 것입니다.','B24','B24','baby'),('p',69,'\"태아는 양수를 마시거나 삼킬 수는 있지만, 아직 변을 보지는 않습니다.\"','B24','B24','baby'),('p',70,'아기의 피부는 쭈글쭈글하고 약한 상태지만 몸에는 살이 조금씩 붙어가면서 엄마의 자궁을 점점 더 채우고 있습니다. 몸은 가늘지만 팔다리의 근육이 발달했습니다. ','B25','B25','baby'),('p',71,'예비 엄마의 자궁이 배꼽 약간 위까지 올라가 있으므로 이제부터는 모든 검사에서 태아의 위치가 발견됩니다. 그러나 양수 속에서 태아는 떠다니기 때문에 태아의 위치는 일정하지 않습니다.','B25','B25','baby'),('p',72,'아기의 입맛이 발달하고 있습니다.','B25','B25','baby'),('p',73,'아기가 드디어 숨쉬기 운동을 시작했습니다. 그러나 아직 폐에 공기가 있지는 않습니다.','B26','B26','baby'),('p',74,'엄마의 배 위로 누군가의 만짐이 느껴지면 아기는 반응을 합니다. 그리고 엄마 배 위로 빛을 비추면 아기는 머리를 빛쪽으로 올려 반응을 합니다. 이 모습으로 아기의 시신경기능이 활동하고 있음을 알 수 있습니다.','B26','B26','baby'),('p',75,'청력이 거의 다 발달했습니다. 소리에 대한 태아의 반응 능력은 귀로 향하는 신경통로가 완성되는 7개월 후 까지는 거의 다 발달합니다.','B27','B27','baby'),('p',76,'아기가 눈을 뜨기 시작했습니다. 만일 아기를 들여다 볼 수 있다면 아기의 눈동자를 볼 수 있을 것입니다.','B27','B27','baby'),('p',77,'\"아기는 엄마의 자궁을 꽉 채울 정도로 열심히 자라고 있습니다. 임신 8개월(만 28~31주)인 태아의 몸무게는 약 1.5~1.8kg) 정도, 키는 약 40~43cm 정도 입니다.\"','B28','B28','baby'),('p',78,'\"태아는 눈을 떴다 감았다 하는가하면, 일정한 시간 간격을 두고 잠이 들었다가 깨어났다 하기도 합니다. 엄마의 자궁 안에서 꼼지락 거리며 몸의 움직임이 많아지고 있는 것 입니다. \"','B28','B28','baby'),('p',79,'손가락을 쭉쭉 빠는 행동은 태어난 후 엄마 젖꼭지나 우유병을 빠는 연습이기도 합니다.','B28','B28','baby'),('p',80,'\"폐는 아직 완전하지 않지만, 만약 조산할 경우 외부의 도움을 얻어 살아갈 수 있을 만큼 커졌습니다.\"','B28','B28','baby'),('p',81,'아기가 눈을 뜰 수 있습니다. 한 쪽으로 계속 빛을 비추고 있으면 아기는 빛 쪽으로 얼굴을 돌리게 될 것 입니다.','B29','B29','baby'),('p',82,'지방이 형성되면서 쭈글쭈글한 피부가 포동포동 해지면서 점차 아기 피부의 모습을 찾고 있습니다.','B29','B29','baby'),('p',83,'세상에 나가서 적응하기 위한 준비의 하나로서 피부 밑에 지방층이 형성되기 시작합니다.','B29','B29','baby'),('p',84,'만약 남자 아기라면 신장 근처에 있던 고환은 사타구니를 지나 음낭 가까이로 가서 자리를 잡습니다. 여자 아기라면 소음순이 음핵을 아직 덮지 않았기 때문에 음핵이 도드라져 보입니다. 음순이 음핵을 완전히 덮는 것은 출산 바로 몇 주 전에 이루어집니다.','B30','B30','baby'),('p',85,'\"뇌도 여전히 급속도로 발달하고 있으며, 그 뇌를 수용할 수 있도록 하기의 머리가 커집니다.\"','B30','B30','baby'),('p',86,'이때쯤에는 태아의 폐와 소화기관이 거의 발달해 있습니다. 이제부터 태아는 몸무게가 급속도로 늘어날 것입니다.','B31','B31','baby'),('p',87,'\"눈꺼풀이 완전하게 만들어진 태아는 요 몇 주 사이에 눈을 떴다 감았다 할 수 있고, 시선 맞추는 연습을 하면서 자궁 안에서 무언가를 볼 수도 있습니다.\"','B31','B31','baby'),('p',88,'\"몸집이 커진 아기는 예전처럼 활발하게 움직이지 않습니다. 몸이 커져 자궁 안에서의 움직임이 자유롭지 않기 때문이죠, 몸을 뒤집거나 180도 회전하는게 쉽지 않습니다.\"','B32','B32','baby'),('p',89,'\"아기는 고개를 양 옆으로 돌릴 수 있고, 각각의 신체 기관들이 활발하게 발달하고 있습니다. 피부 밑에는 지방층도 만들어지고 있습니다.\"','B32','B32','baby'),('p',90,'세상에 나올 훈련으로 태아는 숨쉬는 연습을 합니다. 양수 속에 있는 태아는 세상에 나와 충분한 산소를 마실 수 있도록 연습을 합니다.','B32','B32','baby'),('p',91,'\"남자 아기의 경우 태아의 고환이 복부로부터 음낭속으로 내려오게 됩니다. 어떤 경우에는 하나 또는 두개의 고환이 출산 후에도 제자리를 찾지 못하는 경우가 있습니다. 그러나 걱정 마세요. 출산 후 1년 정도까지는 제자리를 찾게 될 것입니다.\"','B33','B33','baby'),('p',92,'\"이제부터 태아는 출산까지의 기간 7주 동안에 태어날 때의 몸무게 1/3~1/2가 증가합니다. 또, 계속적으로 지방도 축적하게 됩니다. 토실토실 살이 오르고 지방도 축적한 아기는 피부도 매끈매끈 건강하게 변하고 있습니다.\"','B33','B33','baby'),('p',93,'\"태아의 피부색은 백색 지방이 축적되면서 거의 분홍색을 띠게 됩니다. 백색지방은 태아의 체온 조절과 에너지를 내는데 도움을 줍니다. 지방층이 생기며 피부의 주름은 줄어들고, 피부를 덮고 있는 보호 물질인 태지가 점차 두꺼워집니다.\"','B35','B35','baby'),('p',94,'태아는 여전히 양수를 마시기도 하고 오줌으로 배설도 하면서 잘 자라고 있습니다. 이런 활동은 세상에 태어난 후 갓난아기의 신진대사 훈련이기도 합니다.','B35','B35','baby'),('p',95,'\"이제 아기의 몸무게는 2.7kg정도, 키 45~50cm정도입니다. 아기는 편안하게 잘 자라고 있지만 자꾸 커지는 몸 때문에 자궁 속에서 마음대로 움직일 수는 없습니다. 태아가 너무 움직이지 않은 것 같아 불안하다면 의사 선생님과 상의하여 태아 건강을 확인받으세요.\"','B36','B36','baby'),('p',96,'\"이제 아기가 태어날 날이 한 달 밖에 남지 않았습니다. 임신의 막바지입니다. 콩팥, 간, 폐 등 신체기관이 제 역할을 하게 된 태아는 지금 당장 태어나도 잘 자랄 수 있으며, 몸무게는 3kg 전후, 키는 50cm 정도 될 것입니다.\"','B37','B37','baby'),('p',97,'최종 월경일로부터 37주 미만에 출생한 아기를 미숙아 혹은 조산아라고 합니다. 또한 재태 기간 42주 이후에 태어나는 아기를 과숙아라고 부릅니다.','B37','B37','baby'),('p',98,'이 시기에 태아는 태아를 덮고 있던 솜털과 아기의 피부를 보호하던 얇은 표피를 벗어버리게 됩니다. 그러나 일부의 아기는 태어날 때까지 이러한 솜털과 표피를 가지고 있기도 합니다. 반면 머리카락도 자라서 2~4cm 쯤 됩니다.','B38','B38','baby'),('p',99,'\"아기는 다른 분비물과 함께 벗어버린 솜털과 표피를 삼키는데, 출산시에 이것들이 내장에 남아 있게 됩니다. 이것이 태변이며 아기의 장이 최초로 움직이는데 도움을 줍니다.\"','B38','B38','baby'),('p',100,'\"아기는 세상으로 나올 준비를 거의 모두 끝냈습니다. 이 시기 정상적인 아기는 출산 후 체온을 유지하기 위해 지방층을 축적하고 있습니다. 아기의 모든 신체 기관들도 제자리를 잡았고, 마지막 발달 기관인 폐도 거의 다 자랐습니다.\"','B40','B39','baby'),('p',101,'\"태아의 크기는 40cm, 체중은 1.5kg 정도가 됩니다. 몸에 살이 붙은 태아는 피하지방이 적어 주름투성이긴 하지만, 얼굴도 형태가 뚜렷해집니다.\"','B31','B31','baby'),('p',102,'골격이 거의 완성되고 뇌세포와 신경 순환계가 연결되어 활동하기 시작합니다. 태아의 기억력이나 감각 능력이 훨씬 잘 발달하게 됩니다.','B31','B31','baby'),('p',103,'\"양수의 양은 최대로 늘어나지만, 아기도 커져 움직일 공간이 적어져 동작이 둔해집니다.\"','B31','B31','baby'),('p',104,'스스로 체온을 조절하고 호흡할 수 있어 조산해도 생존할 확률이 높은 편입니다. 그러나 아직 피하지방이 부족하고 각 기관이 충분하게 발달하지는 못해 인큐베이터의 도움을 통해서 살아야 합니다.','B31','B31','baby'),('p',105,'\"복부 표면에서도 태아의 힘찬 움직임이 보입니다. 손, 발가락을 꼼지락거리기도 하며 팔, 다리 힘이 좋아져 기운차게 팔을 굽혔다 폈다 합니다. 임신부의 복부 표면에서까지 그 활기찬 움직임을 볼 수 있습니다.\"','B32','B32','baby'),('p',106,'안구의 홍채가 수축 이완을 하기 시작하며 밝은 빛을 비추면 홍채가 수축합니다. 사물을 보기 위해 눈을 떠 초점을 맞추거나 눈을 깜빡일 수 있게 됩니다.','B32','B32','baby'),('p',107,'피하지방이 늘어나고 주름이 없어집니다. 피부색은 피하지방이 늘어나 붉은 기운이 옅어지고 포동포동해지며 예뻐집니다. 태아의 피부밑에 축적되는 백색의 지방은 태아에게 에너지를 주고 태어난 이 후 체중을 조절해주는 역할을 합니다.','B33','B33','baby'),('p',108,'장기도 거의 발달하여 피부의 털도 거의 사라집니다. 손톱은 손가락 끝에 닿을 만큼 자랍니다. 그러나 발톱은 아직 덜 자란 상태입니다.','B33','B33','baby'),('p',109,'머리카락 숱이 꽤 많이 늘어있습니다. 태아 체내의 모든 호르몬 분비샘들이 거의 어른과 비슷한 크기로 자랍니다.','B33','B33','baby'),('p',110,'태아의 위치가 거의 정해집니다. 이 시기의 태아는 대부분이 머리를 아래로 향하며 분만 위치를 잡습니다. 그러나 어떤 태아들은 분만 때까지도 머리가 위로 향한 채 남아 있습니다.','B34','B34','baby'),('p',111,'태아는 움직일 공간이 좁아져 더 꿈틀거리고 덜 차는 등 움직임이 둔해집니다. 그러나 외부 자극에 대해서는 몸으로 반응합니다.','B34','B34','baby'),('p',112,'감각기관이 꽤 발달해 자극에 적극적으로 반응하는 힘이 생기는데 가끔 아기가 웃고 있거나 화를 내는 듯한 표정의 변화가 느껴지기도 합니다. 초음파로 검사해보면 실제로 혼자 빙그레 웃기도 합니다.','B34','B34','baby'),('p',113,'\"태아의 크기는 45~46cm, 체중은 2.3~2.6kg 정도가 됩니다. 드디어 신생아와 거의 비슷한 체형에 이르게 됩니다.\"','B35','B35','baby'),('p',114,'피부 보호 물질인 태지가 매우 두터워집니다. ','B35','B35','baby'),('p',115,'외성기가 다 완성되어 남녀의 구별이 확실해집니다. 발톱도 끝까지 다 자랍니다. 이제까지 급속하게 자라던 것과는 달리 성장 비율이 조금 느려집니다.','B35','B35','baby'),('p',116,'\"폐를 제외한 내장의 기능이 대부분이 완전히 성숙하여 이 시기의 태아는 조산을 해도 호흡에 약간의 문제가 있지만, 대부분 생존합니다.\"','B35','B35','baby'),('p',117,'내장기능도 원활해지고 살이 오르며 근육도 제법 발달합니다. 출산 시기가 가까워져 오며 머리는 점차 골반 안으로 내려오게 됩니다. 이렇게 되면 몸이 고정되어 태아는 움직임이 점점 둔해지게 됩니다.','B36','B36','baby'),('p',118,'태반을 통해 모체로부터 질병에 대한 면역력이 전달되며 태아는 탄생을 기다리게 됩니다.','B36','B36','baby'),('p',119,'\"살이 통통하게 올라 피부의 잔주름이 없어집니다. 심장, 간장, 호흡기, 소화기, 비뇨기 등 모든 장기가 완성됩니다. 몸은 자궁을 꽉 채울 만큼 커져서 등을 움츠리고 팔과 다리를 앞으로 모은 자세를 취하고 있습니다.태아의 배넷 털이 거의 다 빠지고 어깨나 팔, 다리 등 몸의 주름진 부위에만 조금 남습니다.\"','B37','B37','baby'),('p',120,'감염에 대한 저항력도 강해져 이 시기 이후에는 언제 태어나도 문제없는 상태가 됩니다.','B37','B37','baby'),('p',121,'몸은 완전한 4등신이며 신생아와 거의 차이가 없는 얼굴 모양을 갖게 됩니다. 스스로 체온 조절을 할 정도로 지방층이 충분히 갖추어져 있습니다.','B38','B38','baby'),('p',122,'출생 후 얼굴을 긁어 상처를 입히지 않도록 손톱을 잘 감싸주어야 할 만큼 손톱이 길게 자라고 머리카락도 3cm 정도로 자라있습니다.','B38','B38','baby'),('p',123,'밖에서의 생활에 대비해 효소와 호르몬을 저장합니다. 40분 주기로 잠자고 깨어있는 시간의 리듬이 생깁니다.','B38','B38','baby'),('p',124,'\"지금이라도 당장 바깥세상으로 나갈 수 있습니다. 키는 약 50cm, 체중은 약 3㎏, 머리둘레는 가 됩니다.\"','B39','B39','baby'),('p',125,'피부에 윤기가 있고 핑크빛이며 태지도 그리 많지 않습니다. 포동포동하고 피부에는 윤기가 흐릅니다.','B39','B39','baby'),('p',126,'\"소리, 냄새, 빛, 촉감에 반응할 수 있을 만큼 전 영역에 걸쳐 반사작용을 지니게 됩니다. 눈썹도 분명하며 사지를 활발하게 움직이고 배뇨, 배변도 하게 됩니다.\"','B39','B39','baby'),('p',127,'\"신생아에게 미립종이 나타날 수 있습니다. 미립종은 피부 표면에 백색 또는 황색의 작은(1~2mm)돌기의 모양을 나타납니다. 이 돌기의 내용물은 피부 표피와 피지로 이루어져 있으며, 신생아의 약 40%에서 관찰되고 주로 이마, 뺨, 코 등 얼굴에 나타납니다. 미립종은 대개 생후 한달 이내에 그 내용물이 밖으로 터져 나오게 되면서 저절로 사라지게 됩니다.\"','A1','A0','baby'),('p',128,'\"신생아에게 연어반이 나타날 수 있습니다. 연어반은 홍반으로 국소 혈관 확장에 의한 것으로 신생아의 약 30~40%에서 발견되는 흔한 피부 질환입니다. 연어반은 경계가 불확실한 연한 핑크 빛의 반점으로 눈꺼풀이나 목 뒤의 가운데 부위에 흔히 생깁니다. 눈꺼풀의 연어반은 생후 1~2년 뒤면 대부분 사라지나 목 뒤, 후두부의 연어반은 비교적 오래 지속되어 종종 그대로 남습니다. 연어반은 붉은색을 치료할 수 있는 레이저를 사용하면 좋은 효과를 기대할 수 있지만 실제로 레이저가 필요한 경우는 거의 없다고 합니다.\"','A1','A0','baby'),('p',129,'\"신생아들에게도 여드름이 생길 수 있는데, 전체 신생아의 약 20% 정도가 생길 정도로 흔하답니다.\"','A1','A0','baby'),('p',130,'\"신생아중독성홍반은 출생 후 1~3일 경에 나타나기 시작하여, 대게 1주 정도 지속됩니다. 붉은 얼룩 반점들이 몸통, 얼굴, 팔 다리에 산발적으로 나타나는데 반점의 정 중앙에 조그마한 물집이 하나씩 잡혀있습니다. 원인은 잘 알려져 있지 않지만 신생아의 약 30~70%에게 발견될 정도로 흔하며, 시간이 지남에 따라 저절로 없어지는 신생아 시기의 양성 피부 질환입니다.\"','A1','A0','baby'),('p',131,'청력과 시력이 좋아지면서 친근한 사람과 낯선 사람을 구별할 수 있게 됐어요. ','A7','A6','baby'),('p',132,'몸 근육이 많이 발달하면서 다양한 배밀이를 하는 시기에요. 좁은 공간이 답답하게 느껴질 수 있으니 넓은 공간에서 자유롭게 움직일 수 있게 해주세요.','A8','A7','baby'),('r',133,'\"임신 초기는 태아의 각 신체 기관이 분화되는 시기이므로, 태아에게 기형과 각종 장애를 유발하는 약물과 술, 담배 등을 피해야 합니다.\"','B12','B0','mother'),('r',134,'\"입덧으로 인해 영양이 불균형해지기 쉽고, 신경이 예민해지므로, 충분한 휴식을 취하고 영양을 골고루 섭취해야 합니다.\"','B12','B0','mother'),('r',135,'유산의 위험이 있으므로 성생활을 줄이거나 매우 조심해야 합니다.','B12','B0','mother'),('r',136,'임신부가 스트레스를 받으면 태아의 산소가 부족해져서 태아가 육체적 장애를 입을 수 있으므로 임신부가 심리적 안정을 취할 수 있도록 해야 합니다.','B12','B0','mother'),('r',137,'아내는 심리적인 변화가 많은 시기이므로 남편의 따뜻한 관심과 도움이 필요합니다.','B12','B0','mother'),('r',138,'\"태교는 부부가 같이 하는 것이라는 걸 잊지 말자. 남편의 적극적인 태교 참여는, 부드러운 분만으로 이어집니다.\"','B12','B0','mother'),('r',139,'\"임신 중기는 어느 정도 유산의 위험성이 줄어든느 시기이므로, 몸을 부드럽게 움직이는 적극적인 태교를 시작합니다.\"','B28','B13','mother'),('r',140,'\"입덧이 가라앉으면서 식욕이 왕성해지는 시기입니다. 갑자기 체중이 늘지 않도록, 신경을 써서 영양을 섭취해야 합니다.\"','B28','B13','mother'),('r',141,'임신 후기의 분만 체조에 대비해서 몸의 유연성을 적극적으로 길러야 할 때입니다.','B28','B13','mother'),('r',142,'\"체중이 증가하면서 등, 허리, 다리에 통증이 오거나 붓기 시작하므로, 부부가 태교를 함께 할 수 있는 좋은 시기입니다.\"','B28','B13','mother'),('r',143,'\"태동이 점점 강해져서 남편도 태아의 존재를 확실히 느낄 수 있으므로, 부부가 태교를 함게 할 수 있는 좋은 시기입니다.\"','B28','B13','mother'),('r',144,'태아의 오감이 본격적으로 발달하는 시기입니다. 갑작스럽게 불빛이 너무 강한 곳이나 시끄러운 곳에 가지 않습니다.','B28','B13','mother'),('r',145,'\"아빠의 태담이 아이의 지능 발달에 좋은 영향을 주므로, 아빠가 태아에게 동화나 노래를 들려줍니다.\"','B28','B13','mother'),('r',146,'임신 중기에 가장 적절한 운동은 수영입니다. 모든 관절을 부드럽게 해서 순산에 대비합니다.','B28','B13','mother'),('r',147,'진통과 분만을 극복할 수 있는 자율 훈련법을 시행합니다.','B40','B29','mother'),('r',148,'\"배가 점점 커지면서 호흡이 얕아집니다. 엄마와 태아에게는 산소가 충분해야 하므로, 깊은 호흡으로 산소를 충분히 공급합니다.\"','B40','B29','mother'),('r',149,'\"엄마의 정서가 태아에게 그대로 영향을 주므로, 마음을 안정시키고 태아의 뇌와 정서 발달에 좋은 음악을 자주 듣습니다.\"','B40','B29','mother'),('r',150,'\"분만에 대해 긍정적인 마음을 갖고, 진통을 아이가 태어나기 위한 에너지라고 생각합니다.\"','B40','B29','mother'),('r',151,'태아의 모습을 상상해 보고 즐거운 마음을 갖도록 노력합시다.','B40','B29','mother'),('r',152,'부부 관계가 너무 잦으면 조산의 위험이 생기므로 부부 관계를 줄이고 정액이 닿지 않도록 조심합니다.','B40','B29','mother'),('r',153,'산전 교육에서 배운 것들을 분만시에 직접 활용할 수 있도록 충분히 연습합니다.','B40','B29','mother'),('r',154,'조산되거나 예정일보다 먼저 분만할 수도 있으므로 항상 분만 준비를 해둡니다.','B40','B29','mother'),('r',155,'부드러운 분만 환경에 많은 관심을 갖습니다.','B40','B29','mother'),('r',156,'진통과 분만에서 아이의 힘을 빌려보자. 아이도 분만에 필요한 에너지를 가지고 있습니다.','B40','B29','mother'),('r',157,'엄마의 감정이 혈액성분에 영향을 미치면 이것이 태반을 통해 아기의 혈액에 전해지고 간뇌에 전달되어 아기의 행동에 변화를 일으킵니다. 그러므로 이때의 부부싸움은 절대 금해야 합니다.','B21','B21','mother'),('r',158,'아기의 태동이 조금씩 강해지면서 예비아빠도 태동을 느낄 수 있도록 임산부 배 위에 예비아빠의 손을 얹어보세요. 이로써 예비아빠는 곧 세상에 태어날 아기의 존재를 실감하게 되고 예비아빠로서 할 일을 더욱 열심히 하게 될 것입니다.','B21','B21','mother'),('r',159,'배가 불러오면서 허리도 아프고 다리가 붓는 등의 증상이 나타납니다. 임신부로서의 어려움을 덜고 출산시에도 도움이 되도록 마사지와 체조를 하세요. 남편이 해주는 것이 큰 도움이 됩니다. 물론 엄마의 임신체조는 태아의 건강에도 좋은 영향을 미칩니다.','B21','B21','mother'),('r',160,'불러오는 신체에 대해 임신부는 아직 적응이 되지 않았습니다. 몸의 균형도 어색하고 걸음걸이도 자연스럽지 않습니다. 이럴 때 주의할 것은 미끄러지지 않도록 주의하는 것입니다. 약간의 굽이 있는 신발이 아주 편편한 신발보다 좋습니다.','B21','B21','mother'),('r',161,'\"자잘한 변화에도 민감해지면서 이 증상이 문제가 있는 것인지 늘 불안하기만 합니다. 이럴 땐 주위에 임신한 동료들을 찾아 동병상련을 느끼고, 임신 선배들의 도움을 받아 두려움을 없애는 것이 중요합니다. 육아사이트 속에서 동료를 찾거나, 임신과 출산에 대해 강의해주는 프로그램에 참여하는 것이 큰 도움이 됩니다.\"','B22','B22','mother'),('r',162,'\"임신 내내 운동은 필요하지만, 배가 불러올수록 안전하게 운동하는 법을 몸에 익혀야 합니다. 피곤하지 않은 범위에서 안전한 자세로 운동하는 법을 익히세요.\"','B22','B22','mother'),('r',163,'\"진통과 출산에 대한 두려움이 크다면 예비 엄마들을 위한 교육 프로그램에 참가해 보세요. 진통을 줄이는 출산법, 진통을 줄일 수 있는 체조법 등을 배울 수 있습니다. 이때 쯤에는 출산법에 관심을 가지고 미리 대비하는 준비성도 필요합니다.\"','B22','B22','mother'),('r',164,'\"점점 커지는 자궁이 장을 압박하면서 변비가 생깁니다. 또 태아가 영양분을 잘 흡수하도록 도와주는 황체호르몬이 장 내에 음식물을 오래 머물게 하면서 장 운동속도가 느려지기 때문이기도 합니다. 규칙적인 식자, 수분섭취, 잡곡밥과 보리빵의 식사, 섬유질 음식 섭취 등이 변비를 예방하는 방법입니다.\"','B22','B22','mother'),('r',165,'임신부의 몸무게가본격적으로 늘어나는시기입니다.먹고 싶은것도 많아집니다.','B23','B23','mother'),('r',166,'\"일주일에 200~230g 정도의 증가가 적당하므로 지나친 과체중이 되지 않도록 주의해야합니다. 과체중은 출산을 어렵게 하고 출산 후 엄마의 몸매 회복도 어렵게 합니다. 군것질의 횟수와 양을 줄이고, 영양이 풍부하고 건강에 좋은 대체음식을 찾으세요.\"','B23','B23','mother'),('r',167,'오래서 있거나 오래 걷지 않는 것이 좋습니다. 누워서 다리를 높게하고 있으면 한결 나아집니다.','B23','B23','mother'),('r',168,'예비 엄마와 태아의 정서를 가꾸기 위해 미술 태교를 해보세요. 그저 마음에 와닿고 기분이 좋아지는 그림을 음미하는 것이 좋습니다. 미래에 태어날 아기의 모습을 그려보는 것도 훌륭한 미술태교입니다.','B23','B23','mother'),('r',169,'\"임신 트러블에 대처하는 일반적인 방법을 알아보고, 또 그것을 기초로 하여 나만의 방법도 개발해 보세요. 일례로, 다리나 손이 붓는 것은 정상이지만 이러한 부종을 최소화하기 위해서는 물을 충분히 마시는 것이 가장 좋은 방법입니다.\"','B23','B23','mother'),('r',170,'단백질 섭취도 임신 중에는 중요합니다. 단백질은 고기에서만 섭취하는 것은 아닙니다. 두부로도 필요한 단백질을 충분히 섭취할 수 있습니다. 두부와 함께 브로콜리나 신선한 버섯 등을 함께 섭취하면 더욱 좋습니다.','B23','B23','mother'),('r',171,'양치질을 할 때 피가 날 수도 있습니다. 이것은 임신에 따라 분비된 호르몬이 잇몸을 붓게하고 염증을 일으키기 때문인데 자연스런 임신 증상 중의하나입니다. 칫솔질을부드럽고 천천히하세요.','B24','B24','mother'),('r',172,'이제 태동이 본격화되면서 아빠도 엄마의 배 위에 손을 얹으면 아기의 움직임을 쉽게 느낄 수 있습니다. ','B24','B24','mother'),('r',173,'아내는 조금씩 임신에 대해 힘들고 지칠 수 있는 시기입니다. 남편과 임신에 대한 느낌을 공유하고 함께 할 수 있는 일을 찾아보세요. 집 주변을 함께 산책하거나 예비 엄마 교실에 참여하는 일도 좋은 방법입니다.','B24','B24','mother'),('r',174,'24~26주 사이에 의사 선생님은 임신성 당뇨에 대해 검사를 하실 것입니다. 임신성 당뇨는 임신부 중 4% 정도에서 나타나는 합병증입니다.','B24','B24','mother'),('r',175,'예비 엄마가 밤에 숙면을 취하지 못할 수 있습니다. 몸에 변화가 많이 생기면서 예전의 일상적인 생활이 점점 어려워지기 때문입니다. 몸에 무리가 가지않도록 산책을 하는 것은 임신부 운동으로도 좋고 숙면을 취하는 방법이기도 합니다.','B25','B25','mother'),('r',176,'하루 세끼의 식사만으로는 부족하다는 느낌이 있을 수 있습니다. 중간중간 간식 생각이 간절해지기도 합니다. 간식을 통해 충분한 영양 섭취가 중요하지만 과다체중을 부르는 과식이 되지 않도록 식단 점검을 해보세요.','B25','B25','mother'),('r',177,'\"비타민A가 풍부한 당근은 간식으로 아주 좋습니다. 지용성 비타민 또한 태아의 세포 성장과 눈 발달에 도움이 되고 출산 후 엄마의 몸조리에도 도움을 줍니다. 단, 지용성 비타민은 과다 복용하면 좋지 않은 영양소입니다.\"','B25','B25','mother'),('r',178,'태어날 아기에 대한 걱정이 많아지면서 점차 다가오는 출산에 대한 두려움이 나타날 수 있습니다. 긍정적인 생각으로 두려움을 없애 보세요. 아기는 엄마의 걱정과는 다르게 무럭무럭 잘 자라고 있을 것입니다.','B26','B26','mother'),('r',179,'커진 자궁이 예비 엄마의 횡경막을 위로 밀게 되연서 엄마는 호흡 곤란증을 느낄 수 있습니다. 증상이 견디기 힘들 정도로 심하다고 생각되면 의사와 상담하세요.','B26','B26','mother'),('r',180,'임신 빈혈을 한번 더 체크하세요. 전에 체크한 결과 임신 빈혈이 아니었어도 지금쯤 한번 더 체크하는 것이 좋습니다.  임신 빈혈에 대해 확실하게 검사하여 안심을 하는 것이 좋습니다.','B26','B26','mother'),('r',181,'\"이때는 체중이 눈에 띄게 불어나면서 임신부 스스로도 스트레스를 받을 수 있습니다. 체중이 느는것에 대해 곁에서 위로 해주고, 아내의 기분이 상하지 않도록 체중관리를 도와주어야 합니다.\"','B26','B26','mother'),('r',182,'\"태아에게만 관심을 집중 할 것이 아니라, 두고 두고 추억할 수 있는 임신 기간 동안의 추억을 만드는 것도 태교의 좋은 방법입니다.\"','B26','B26','mother'),('r',183,'\"방광염을 예방하기 위해서는 외음부를 청결하게 하고 소변을 참지 말며, 물을 많이 마십니다. 또 소변을 볼 때는 완전히 방광을 비우도록 하고 순연으로 된 속옷을 입습니다.\"','B26','B26','mother'),('r',184,'체중이 갑자기 늘고 눈앞이 잘 보이지 않으며 손과 발이 붓는다면 빨리 의사 선생님과 상의하세요. 임신 중독증일 수 있습니다. 임신 중독증의 증상은 부종/고협압/단백노입니다.','B27','B27','mother'),('r',185,'임신부는 호르몬 분비 때문에 잠을 이루지 못 할 정도로 몸이 가려울 수 있습니다. 또는 피부가 늘어나면서 튼살이 가려움증을 유발하기도 합니다. 긁어서 피부에 트러블이 생겼다고 함부로 연고를 발라서는 안됩니다. 아침 저녁으로 로션이나 오일을 발라 건조함을 예방하고 수분을 공급해주는 것이 최선의 방법입니다.','B27','B27','mother'),('r',186,'미술 전람회 등 눈과 마음을 즐겁게 하는 전시회에 다니는 것도 좋은 태교입니다. 엄마가 아름다운 그림을 보면서 좋은 감정을 느끼면 그것이 태아에게도 전달되어 아기의 감성에 좋은 영향을 준다고 합니다. ','B27','B27','mother'),('r',187,'\"르노아르 모네, 마네, 밀레등 우리와 비교적 익숙한 화가들의 전시회가 있다면 열심히 다녀보세요. 물론 명화집을 통해 그림을 보는 것도 좋습니다. 강렬한 선과 색으로된 그림 보다는 부드럽고 편안한 색과 선으로된 풍경화나 정물화가 좋다고 합니다.\"','B27','B27','mother'),('r',188,'이제 서서히 출산 상황을 상상해 보고 무엇을 준비해야 할지도 생각해 보세요. 출산 임박시 병원에 가기 위해서 어떤 일을 미리 해 두어야 할까? 우리 아기에게 필요한 육아 용품은 무엇일까? 산후 조리는 어디에서 해야 할까? 상의하며 출산을 대비하세요.','B27','B27','mother'),('r',189,'\"집안 분위기를 조금씩 바꾸면서 기분 전환을 해보세요. 남편의 도움을 받아 가구 위치도 옮겨보고, 소파의 방석도 바꾸어 보세요. 아니면 곧 태어날 아기의 소품을 하나 만들거나 구입하여 거실 한쪽에 놓아보세요. 기분 전환은 좋은 컨디션을 유지하게 해줍니다.\"','B28','B28','mother'),('r',190,'어떤 출산법을 선택할 것인가 결정하기에 앞서 어떤 출산법이 내게 맞는지 알아보기 위해서라도 예비 엄마 교실에 참여해 보세요. 미리미리 부부가 함께 훈련을 받아야할 출산법도 있습니다.','B28','B28','mother'),('r',191,'점점 배가 부르면서 애기를 키운다는것에대해 두려움을 갖게되는 아내를 위해 육아관련 방법을 알려주는 예비 엄마 교실에 남편도 함께 참여해 보는것은 중요한 일입니다.','B28','B28','mother'),('r',192,'\"임신 후기의 마지막 3개월 동안 임신부들은 치질로 고생을 할 수 있습니다. 자궁이 직장 정맥을 누르게 되기 때문입니다. 섬유질이 많은 음식을 섭취하고, 오래 서 있거나 앉아있지 않는 것이 치질을 예방하는 방법입니다.\"','B28','B28','mother'),('r',193,'\"과체중을 예방하고 몸이 붓지 않게 하기위해서는 인스턴트 음식을 자제해야 합니다. 인스턴트 속에는 많은 칼로리, 염분, 당분이 자연 식품보다 많이 들어 있기 때문입니다. 불가피하게 먹게 되면 칼슘이나 철분이 부족하지 않도록 우유나 유제품, 야채나 과일을 많이 먹습니다.\"','B28','B28','mother'),('r',194,'태어날 아기를 미리 상상하면서 아기 용품을 미리 만들어 보세요. 알록달록 헝겊으로 모빌도 만들어보고 아기 턱받이 등 만들기 손쉬운것들은 누구든 만들 수 있습니다.','B29','B29','mother'),('r',195,'임신 7-8개월은 뇌의 발달이 마무리 되는 시기이니 엄마가 산소를 충분히 공급 해주어야 태아의 뇌세포가 발달합니다. 가벼운 산책을 하는 것이 도움이 됩니다.','B29','B29','mother'),('r',196,'\"8개월부터~9개월까지는2주에 한번씩병원의진료를 받습니다. 병원에가는 일이 잦아지면서 임신부는몸이힘들고출산에대한 두려움이또 생깁니다. 병원에서 혹은예비엄마교실등에서 임신부 동료들을만나불안감을떨쳐버리세요나만이 겪는 임신의 고통이 아니며, 내가느끼는임신에따른증상들은대개정상적인 징후들입니다.\"','B29','B29','mother'),('r',197,'\"이제태어날아기에게모유를 먹일지분유를먹일지한번생각해봐야합니다. 물론지금의결정이100%반영되는것은아닙니다. 대부분은 모유수유를 우선하여 원합니다. 모유수유와분유수유의특성을잘알고, 전반적인상황을고려하여 결정하는 것이 필요합니다. 어떤수유를할지에따라그에따른수유용품준비가필요할수있습니다.단, 엄마의초유는어떤 경우이든반드시 아기에게 먹이는 것이좋습니다.\"','B29','B29','mother'),('r',198,'염분의 지나친섭취는 임신 중독증의원인이됩니다.간장이나된장등 짠맛을내는양념 사용을최대한줄이세요. 특히 인스턴트 음식은 염분의섭취를늘일수 있으므로 좋지 않습니다.또한 인스턴트 음식은영양소의흡수를방해하고 혈압을상승시킬수 있습니다. 역시임신 중독증의가능성을높이므로 가능한 인스턴트 음식은 먹지 않습니다.','B30','B30','mother'),('r',199,'\"만삭이 되면움직이기도불편하고, 언제출산할지 모른다는 부담감때문에외출이쉽지 않습니다. 또 아기가태어난이후에도한동안은 부부동반의 외출이어렵습니다. 그러므로 지금쯤아내와함께원 없이 즐기는외출 계획을세우세요. 즐거운외식과영화를는 것도 좋습니다. 아니면아기용품을구입하기위한외출도좋습니다.\"','B30','B30','mother'),('r',200,'\"아기이름을짓는 일이 결코간단하지않습니다. 엄마와아빠가함께머리를맞대고아기의이름을지어보세요. 너무 막연한일이므로, 이름짓는 원칙을 하나둘세우면서이름을 지으세요.\"','B30','B30','mother'),('r',201,'\"만의 하나아기가예상보다 일찍 세상에나올 수도있습니다.출산의징후는어떤 것인지, 조기출산에는어떻게대응을 해야하는지 미리미리공부해두세요.\"','B30','B30','mother'),('r',202,'\"임신 중에 가장 좋은 운동은 걷기 운동입니다. 기분 전환은 물론 과다체중 예방의 효과도 있기 때문입니다. 엄마가 걸으면서 마시는 산소량은 태아에게도 전해져 아기의 뇌세포 생성에 도움을 준다고 합니다. 몸이 무거워운동이 힘들때, 집 주변을 조금씩 걸어보세요.\"','B31','B31','mother'),('r',203,'예비 엄마 교실이나 인터넷 속의 육아사이트 등에서 출산을 준비하는 운동을 알아보고 틈이 날 때마다 운동하세요.','B31','B31','mother'),('r',204,'임신후기에는당연히 몸무게가늘어납니다. 일주일에 0.5.g정도 늘어나게 될 것입니다. 엄마의 몸무게 증가와 함께 아기의 성장이 절정에 이르는 만큼 충분한 영양이 필요합니다.','B32','B32','mother'),('r',205,'\"출산을 준비하면서 자궁 경부에서는 분비물이 많이 생깁니다. 분비물 때문에 외음부에 피부염이나 습진, 가려움증이 생길수 있으므로 늘 몸을 깨끗이 합니다.\"','B32','B32','mother'),('r',206,'\"아빠의 협조가많이 필요합니다. 아기를 위한 출산 용품에 대해 함께 의논하고, 구입을 위해 함께 외출을 하세요. 이렇게 부부가 함께 출산을 준비하는 것도 부부의 사랑을 확인하고 지키는 중요한 일입니다.\"','B32','B32','mother'),('r',207,'몸의 중심 잡기가 더 힘들어지는 이 시기에는 조산의 위험도 있으므로 외출할 때는 사람과 부딪히거나 계단에서 넘어지는것등을 주의하세요.','B32','B32','mother'),('r',208,'\"무엇보다피로하지 않도록충분히휴식을취해줘야합니다. 오래서 있거나, 무거운것을들거나, 오래앉아있는 일이 없도록합니다. 다리를 높이하고 쉬는 것이 다리의 피로를 푸는 좋은 방법입니다. 무리하지 않도록 조심하면서 피곤할 때는 중간중간에 충분히 휴식을 취합니다.\"','B32','B32','mother'),('r',209,'의사 선생님의 검진을 통해 조기 출산의 징후가 없는지 체크하세요. 만약 있다면 의사 선생님은 절대 안정을 권할 것 입니다.','B32','B32','mother'),('r',210,'\"배가 부르면서 반듯이 누워서 자는 자세가 힘이 듭니다. 또, 바로 누우면 자궁 뒤쪽으로 통하고 있는 혈관이 압박을 받아 엄마 몸 하반신으로의 혈액순환이 원활치 못하게 됩니다. 원활치못한 혈액순환은 엄마의 혈압을 내려가게하고 태반으로의 혈액순환도 방해하여 태아에게도 좋지않습니다. 그러므로 베개나 쿠션을 이용하여 옆으로 눕는 편안한 자세를 찾아야 합니다.\"','B32','B32','mother'),('r',211,'\"이제 출산시기가 점점 다가오고 있습니다. 이때쯤에는 무엇을 해두어야 하는지 점검해 보세요. 진통이 오는 아내를 어떻게 병원에 데려갈 것인가? 출산 후 에는아내에게 무엇을 해주어야하는가? 아내가 집을 비우는 동안 내가 해야 할 것은 무엇인가? 등 미리미리 점검해두세요.\"','B33','B33','mother'),('r',212,'\"서서히 직장을비워야할 시기가 다가옵니다. 출산 휴가까지 무슨 일을 어떻게 정리해야 하는지, 후임에게 어떤 인수인계를 해야할지 생각해 보세요. 출산후에도 일을 계속하실 계획이라면 출산전까지의 일을 완벽하게 마무리하는 것이 무엇보다 중요합니다.\"','B33','B33','mother'),('r',213,'\"얼굴, 손, 발, 발목 등 엄마의 몸이 많이 붓고 있습니다. 특히 날씨가 덥거나 저녁이 되면 더 심해지는데 이렇게 몸이 부을때는 물을 많이 마시는 것이 도움이 됩니다.\"','B34','B34','mother'),('r',214,'불면증이 심할 때는 잠자기 전에 따뜻한 물로 목욕을 하거나 따뜻한 우유를 한 잔 마셔보세요. 엄마가 불면증에 시달린다고 태아도 잠을 못자는 것은 아닙니다. 아기는 자기 나름대로의 리듬을 가지고 잠을 자고깨기 때문입니다.','B34','B34','mother'),('r',215,'잠을 자는 자세가 점점 불편해지면서 예비 엄마는 숙면을 취하지 못합니다. 옆으로 누워다리 사이에 쿠션이나베개를 끼우면 조금 편안한 자세가 될 수 있습니다.','B34','B34','mother'),('r',216,'\"만삭이되고, 출산 후 아기를 키우게 되면 남편과의 오붓한 시간을 가지기란 거의 불가능합니다. 한동안 누리지 못하게 될 부부만의 시간을 잘 간직하기 위해 지금이 부부만의 오붓한 시간을 가질 적기입니다.\"','B34','B34','mother'),('r',217,'\"좀 더 수월한 출산을 위해, 엄마와 아기의 건강한 출산을 위해 출산 호흡법을 연습하세요. 임신 관련 서적이나 인터넷에서 이에 관한 자료를 구할 수 있습니다. 지금의 연습이 출산에 큰 도움이 된다는 것을 잊지 마세요.\"','B34','B34','mother'),('r',218,'\"집이 아닌 친정이나 시댁 등, 타지에서 출산할 계획이라면 미리 그 동네와 가까운 산부인과를 찾아가보세요. 출산할 병원을 정하고, 시설을 확인하며, 미리 진단 받아 보아야 예상치 못한 상황에서도 당황하지 않습니다.\"','B34','B34','mother'),('r',219,'\"아기 공간을 꾸며보세요. 이불과 침대는조금 넉넉한 크기로 준비해야합니다. 그리고 아기가주변을 둘러 볼 수 있도록 시야가 트이고, 아기의 시야에 모빌이나 예쁜 그림을 걸어 두는 것도 잊지 마세요. 아기도 엄마가 아기방을 꾸미며 느끼는 행복을 전달 받을 수 있습니다.\"','B35','B35','mother'),('r',220,'\"초산은 대개 진통이 10분 간격으로 찾아오면 병원에 갑니다. 경산부라면 15~20분 간격일 때 병원에 갑니다. 출산 병원의 예약을 확인하세요. 출산법에 따른 시설 점검도하구요. 아기를 위한 유아 용품도 모두 소독하고 세탁해 놓았는지 점검합니다.\"','B35','B35','mother'),('r',221,'이때쯤 부터는 언제 어디서 출산의 상황을 맞을지 모릅니다. 외출할 때에는 반드시 자신의 연락처 등이 기재된 산모 수첩을 꼭 가지고 다니세요.','B35','B35','mother'),('r',222,'임신 후기가 되면 자궁구가 열릴 가능성이 많으므로 욕조 목욕은 피하는 것이 좋습니다. 따뜻한 물로 자주 샤워하는 목욕법을 택합니다.','B36','B36','mother'),('r',223,'\"영화 음악은 엄마의 마음을 편안하게 해주는데 효과가 큰 음악이라고 합니다. 태교 음악으로 꼭 클래식을 고집할 필요는 없습니다. 좋아하는 음악, 마음이 편안해지는 음악이면 됩니다. 그런 의미에서 영화 음악은 엄마에게 잔잔한 영상과 함께 평안하고 부드러운 느낌을 줄 수 있어 태교음악으로 좋습니다.\"','B36','B36','mother'),('r',224,'이제부터 1주일에 한번씩 병원을 찾아가 진단을 받아야 합니다. 진단을 받으면서 출산이 다가오면서 느껴지는 모든 증상에 대한 궁금증을 해결하세요. 편안한 마음으로 느긋하게 출산을 기다릴수 있도록 마음의 불안을 떨어내는 것이 좋습니다.','B36','B36','mother'),('r',225,'\"조산을 하지 않도록 몸조심을 하세요. 가장 중요한 일은 배에 힘이 들어가지 않도록 주의하는 일입니다. 과한 운동을 하지 않고, 집안 일을 심하게 하지 않으며, 무거운 것을 들지도 않습니다.\"','B36','B36','mother'),('r',226,'\"매주 받는 진료에서 의사는 언제 자궁경관이 열리거나 얇아지며, 아기가 어떤 상황인지를 체크하게 됩니다. 아기가 골반 쪽으로 많이 내려오는 느낌이 든다면 의사에게 알리는 것이 좋습니다.\"','B37','B37','mother'),('r',227,'언제 출산이 다가올지 모릅니다. 조산아(미숙아)와 과숙아에 대해 사전 지식을 알아보고 어떤 상황도 대처할 수 있도록 출산 준비를 다시 점검하세요.','B37','B37','mother'),('r',228,'\"샤워도 매일하고, 머리도 매일감고, 외음부를 청결히 하세요. 출산을 위해 매일매일 해야하는 준비사항입니다.\"','B37','B37','mother'),('r',229,'\"여전히 1주일에 한 번씩 병원을 찾아가 진단을 받아야 합니다. 매주 받는 진료에서 언제 자궁 경관이 열리는지 또 언제 자궁 경관이 얇아지는지, 양수가 새지 않는지, 아기가 얼만큼 내려왔는지 체크하세요.\"','B37','B37','mother'),('r',230,'출산시 아내의 고통을 조금이라도 줄이기 위해 남편은 무엇을 해야 하는지 생각해 보세요. 선택한 출산법에 따라 남편의 역할이 다를 것입니다.','B37','B37','mother'),('r',231,'남편은 분만을 아내와 함께 할 수 있는 경우도 있고 그렇지 못 할 경우도 있습니다. 가능한 아내의 분만시 곁에서 힘이 되어 줄 수 있는 방법을 출산할 병원의 의사 선생님과 상의하고 실천 방법을 계획하세요.','B37','B37','mother'),('r',232,'\"임신후기에 약간 피가 비치는 것이 이슬인데, 이슬이 비친 후 며칠이나 몇 시간 후면 진통이 시작됩니다. 반면 양수가 터지면 물이 흐르는 것처럼 흐릅니다. 선홍색 분비물이 계속 흐르거나 양수가 터진 느낌이 있다면 즉시 의사와 상의하세요.\"','B38','B38','mother'),('r',233,'엄마의 몸이 서서히 출산을 준비하고 있습니다. 자궁의 출구가 부드러워지고 또 축축해 집니다. 엄마는 몸을 깨끗이 하고 출산을 기다려야합니다.','B38','B38','mother'),('r',234,'휴식을 취하면서 복식 호흡을 하면 태아에게 산소공급을 해주는 한편 출산시 호흡 연습을 하는 결과를 얻게됩니다.','B38','B38','mother'),('r',235,'입맛이 좋아 아무 음식이나 잘 먹을 수 있지만 체중이 지나치게 불지 않도록 조심하면서 소화되기 쉬운 음식을 드세요.','B38','B38','mother'),('r',236,'\"여전히 1주일에 한 번씩 병원을 찾아가 진단을 받아야 합니다. 매주 받는 진료에서 언제 자궁 경관이 열리는지 또 언제 자궁 경관이 얇아지는지, 양수가 새지 않는지, 아기가 얼만큼 내려 왔는지 체크하세요.\"','B38','B38','mother'),('r',237,'\"첫째 아기가 있다면 엄마와 아빠의 사랑을 느낄 수 있도록 해주어야 합니다. 병원에 가면 엄마와 떨어져 있어야 하는 상황, 동생이 생기는 상황에 대하여 충분히 설명하여 소외감을 느끼지 않도록 해주어야합니다. 가능하면 아기가 엄마와 떨어져 있는 동안 다른 집에 가 있기보다는 아기를 돌봐줄 사람이 집으로 오는 일이 아기의 심리상태에 도움을 줍니다.\"','B38','B38','mother'),('r',238,'이때쯤 부터는 언제 어디서 출산의 상황을 맞을지 모릅니다. 외출 할 때에는 반드시 자신의 연락처 등이 기재된 산모 수첩을 꼭 가지고 다니세요.','B38','B38','mother'),('r',239,'예비 엄마의 몸은 무겁고 몸을 움직이기도 불편합니다. 그러나 혼자 조용히 보낼 수 있는 마지막 시간이라 생각하시고 이 시간을 느긋하게 즐기세요.','B40','B39','mother'),('r',240,'엄마가 느끼지 못하는 사이에 엄마의 몸은 출산의 준비를 서서히 시작하고 있습니다. 새로운 징후가 느껴지면 의사 선생님과 상의하세요. 각각의 사오항에서 필요한 대처법을 알고 있어야 합니다.','B40','B39','mother'),('r',241,'출산에 대비한 호흡법과 체조를 조심스럽게 하세요. 몸이 무겁다고 처져있는 것은 별로 도움이 되지 못합니다. 출산시의 체력 훈련을 위해서라도 적당히 몸을 움직여야 합니다. 무리하지 않는 범위에서 호흡법과 체조를 연습하세요.','B40','B39','mother'),('r',242,'\"어떤 징후가 오면 병원에 가야하는지 다시 한번 체크하세요. 또, 언제든 아내의 연락을 받을 수 있도록하세요. 만약의 상황에 아내가 병원에 갈 수 있는 교통편, 도와줄 사람 등을 모두 체크하세요.\"','B40','B39','mother'),('r',243,'아기가 집에 온 후 무엇이 필요한지 점검하세요. 아기 용품은 물론 산후조리기간 동안 아기를 돌봐줄 사람에 대한 점검도 필요합니다.','B40','B39','mother'),('r',244,'아기가 꼭 예정일에 태어나는 것이 아니므로 자궁이 수축되는 듯하면 규칙적으로 일어나고 있는지 체크하여 병원에서 상담을 받습니다.','B36','B36','mother'),('r',245,'간혹 자궁경부 구가 미리 열리는 임신부도 있는데 이럴 경우 안정을 취하며 결과를 지켜보아야 합니다.','B37','B37','mother'),('r',246,'태아가 지나치게 조용하거나 태동이 없으면 배에 귀를 대 보고 살짝 건드려 반응을 살펴봅니다. 자극을 주었는데도 반응하지 않으면 즉시 병원에 가야 합니다.','B38','B38','mother'),('r',247,'출산이 가까워지면 배가 당기는 증상이 빈번해지나 진통이 시작된 것은 아닙니다. 이것은 출산을 위한 예행연습으로 진통이 불규칙적이라면 가진통으로 걱정할 필요가 없습니다.','B39','B39','mother'),('r',248,'\"출산이 임박하면 임신부의 몸은 다음의 증세가 나타납니다. 피가 섞인 이슬이 비치고 규칙적인 진통이 시작됩니다. 이슬이 비치고도 2~3일, 길게는 일주일 후에 출산하는 경우도 있습니다.\"','B40','B40','mother'),('r',249,'\"대개 진통이 먼저 시작되고 파수가 되지만, 진통이 시작되기도 전에 파수가 이루어지기도 하므로 소변인지 파수인지 판단이 서지 않을 때는 바로 병원으로 가서 진찰을 받습니다.\"','B40','B40','mother'),('r',250,'출산 후 근육과 인대의 탄력이 저하되고 관절이 느슨해져 있어요. 허리 통증이 심해지면 디스크나 신체불균형이 될 수 있으니 병원을 방문해보세요.','A7','A6','mother'),('r',251,'출산 후 엄마는 잇몸이 많이 약해져 있어요. 잇몸이 상하지 않도록 부드러운 칫솔과 치실을 사용하고 자극적인 음식은 피하는게 좋아요.','A7','A6','mother'),('r',252,'임신하면서 배가 불러오면서 복직근이라는 근육이 옆으로 늘어져 벌어진다고 해요. 출산 후 6개월이 지났으니 복근을 강화하는 근력운동이 가능하답니다.','A8','A7','mother'),('r',253,'엄마한테서 받은 면역력이 많이 떨어질 시기에요. 근처 소아과와 응급병원 위치를 잘 파악해주세요.','A8','A7','mother'),('r',254,'가끔 우울하실 때가 있으신가요? 육아에 대한 스트레스를 인정하고 가족과 진솔한 대화를 나눠보는 것이 큰 도움이 될 수 있어요.','A12','A7','mother'),('p',255,'이 시기의 자궁은 거의 배까지 커져있어요. 자궁은 맨 위족은 거의 위장 아래까지 닿아 있기도 하답니다. 자궁은 앞으로도 매주 1cm 정도씩 자랄 거예요.','B28','B24','mother'),('p',256,'월주기가 28일인 경우에 마지막 생리 첫날부터 14일 후인 배란기에 난소에서 배출된 난자는 나팔관 내에서 정자와 만나 수정이 됩니다. 수정란이 자궁내막으로 내려와서 착상을 하게 됩니다. 이 기간이 임신 3주입니다. 모체는 별 변화를 느끼지 못하게 됩니다.','B3','B3','mother'),('p',257,'\"임신 지속을 위한 황체호르몬이 계속 분비됩니다. 겉으로 드러나는 뚜렷한 변화는 없지만, 예민한 여성의 경우 감기와 비슷한 증상을 나타내 으슬으슬 춥거나, 열이 오르고 온몸이 나른한 증세가 나타나기도 합니다.\"','B4','B4','mother'),('p',258,'이 시기에는 입덧이 시작되며 유두가 민감해집니다. 이른 아침이나 빈속일 때 입덧 증세가 심해집니다. 온몸이 나른해지고 졸리며 쉽게 피로해지며 유두가 민감해져 따끔거리고 유방 피부밑의 혈관들이 눈에 띄게 됩니다.','B5','B5','mother'),('p',259,'임신하면 호르몬의 영향으로 자궁으로 가는 혈액의 양이 늘어나고 대사 작용이 활발해지면서 이로 인해 땀이 많이 나고 질 분비물의 양도 늘어납니다. 질 분비물의 색은 유백색으로 끈적끈적하지만 냄새나 가려움은 거의 없는 것이 특징입니다.','B6','B6','mother'),('p',260,'소변이 자주 마렵습니다. 임신하게 되면 융모성선 자극 호르몬이라는 호르몬이 분비됩니다. 이 호르몬의 작용 중 하나가 골반 주위로 혈액이 몰리게 하는 것이고 혈액이 골반에 몰리게 되면 아무래도 방광에 자극을 받게 되며 거위 알 정도로 커진 자궁이 방광을 눌러 소변을 더욱 자주 마렵게 합니다.','B7','B7','mother'),('p',261,'배나 허리가 팽팽해지면서 긴장이 되기도 하고 황체호르몬의 영향으로 장의 움직임이 둔해져 변비에 걸리기 쉽습니다. 또 달이 거듭될수록 자궁이 커지면서 방광을 압박하게 됩니다.','B7','B7','mother'),('p',262,'유방은 크기가 더욱 커지며 단단해지고 무거워집니다. 임신부에 따라서는 응어리가 생긴 듯 기분이 들기도 하고 통증을 느끼는 때도 있습니다. 젖꼭지 색깔도 짙어지고 배가 당기는 느낌이 오기도 합니다.','B8','B8','mother'),('p',263,'유방의 변화가 한층 두드러지고 입덧을 못 느꼈던 임신부도 이 시기엔 정도의 차이가 있지만 대부분 입덧을 느낍니다. 입덧하면 침과 트림이 많이 나오는데 이유는 타액선의 자극으로 침의 양이 증가하고 위와 십이지장의 운동성이 떨어져 음식물이 위에서 발효되기 때문으로 알려져 있습니다. 자궁의 크기가 점차 주먹만 하게 커지며 하복부가 당기거나 요통이 오기도 합니다.','B9','B9','mother'),('p',264,'\"자궁이 주먹 크기 정도로 커집니다. 자궁이 아직 골반 내에 있어 배가 부르지는 않지만, 치골 위에 손을 대보면 자궁이 커진 것을 확실히 느낄 수 있습니다. 커진 자궁이 방광과 직장을 압박하여 소변보는 횟수가 잦아집니다.\"','B10','B10','mother'),('p',265,'질과 음부에 공급되는 혈액량이 늘어 짙은 자주색을 띠고 분비물도 늘게 됩니다. 분비물이 늘어나는 것은 질의 세균이 자궁으로 들어가 태아에게 감염을 일으키는 것을 막기 위한 보호의 역할을 합니다. 단 냉과 구별해야 할 것은 분비물이 진한 노란색이거나 치즈처럼 엉긴 찌꺼기가 나오거나 가려울 때는 곰팡이나 세균 등에 감염된 것일 수 있으므로 치료를 받아야 합니다.','B11','B11','mother'),('p',266,'대사량이 증가하여 분비물이 더욱 늘어날 수 있습니다. 체내 혈액 총량이 늘어나고 골반 내의 혈액순환이 더욱 왕성해짐에 따라 유백색의 분비물이 더욱 늘어날 수 있습니다. 허리가 무겁게 느껴지며 발목에 경련이 일어나기도 하며 변비나 설사가 생기기도 합니다. 예전에 피부 문제가 있었던 임신부는 피부가 건조해져 가려움증이 느껴지기도 합니다.','B11','B11','mother'),('p',267,'\"입덧이 차츰 가라앉고 편안해집니다. 입덧 증세가 차츰 없어지며 식욕이 늘게 되어 임신부의 얼굴색이 좋아집니다. 정신적으로 안정, 편안한 상태가 되며 고온기였던 기초체온이 떨어지기 시작하여 출산할 때까지 계속됩니다.\"','B12','B12','mother'),('p',268,'배가 나오는 임신부도 있습니다. 태아가 성장하며 자궁 기저부가 확실히 느껴지게 됩니다.','B12','B12','mother'),('p',269,'\"항상 손발이 따뜻합니다. 호르몬 분비량이 안정적으로 변화하며 불안하던 감정이나 히스테릭하던 증상이 차츰 가라앉게 됩니다. 심장에 가해지는 부담이 최대치의 수준에 오르게 됩니다. 앞으로의 기간 동안 계속 이런 상태가 되는데 혈압을 낮추기 위해 손과 발의 정맥이 이완, 모체는 손발이 항상 따뜻한 상태가 됩니다.\"','B13','B13','mother'),('p',270,'이 시기가 되면 자궁이 커지고 양수도 늘어나기 때문에 몸무게가 늘고 배가 나옵니다. 유방이 커지면서 수유를 위한 준비를 합니다. 자궁을 지탱하는 인대가 당겨 사타구니나 허리가 아프고 피곤을 자주 느끼게 됩니다.','B14','B14','mother'),('p',271,'자궁의 크기가 어린아이 머리 크기만큼 되고 자궁 기저부가 확실히 느껴질 정도로 골반 가장자리까지 올라와 아랫배의 부풀어 오름이 눈에 띄게 됩니다. 그렇지만 자궁 위쪽으로 커지기 때문에 방광으로의 압박은 적어집니다. 자주 소변이 마려웠던 증상이 차츰 좋아집니다.','B15','B15','mother'),('p',272,'안정기에 들어갑니다. 유선이 발달하여 유방이 더욱 커지며 피하지방이 부어 몸매가 두루뭉술해지며 완연한 임신부의 몸이 되어 갑니다.','B16','B16','mother'),('p',273,'위나 소장 같은 내장이 커지는 자궁에 의해 밀려 올라가 식후에 체한 듯 갑갑한 증상과 등이나 허리가 아플 때도 있습니다.','B16','B16','mother'),('p',274,'피부의 색소 침착이 증가합니다. 자궁이 멜론 크기만 하게 커지며 피부의 색소 침착이 증가함에 따라 젖꼭지와 둘레의 색이 훨씬 짙어집니다. 젖꼭지가 따갑고 시큰거리기도 하며 젖샘 분비를 위한 유선의 발달이 두드러지며 유방이 훨씬 커져 수유를 위한 준비가 한창 이루어지는 시기입니다.','B17','B17','mother'),('p',275,'피부표면의 정맥이 눈에 띄게 나타나기도 합니다. 임신부에 따라 얼굴에 소위 말하는 임신성 기미가 생겨나기도 합니다. 임신성 기미는 출산 후에는 사라지는 것이 특징입니다.','B17','B17','mother'),('p',276,'통계적으로 경산부의 경우 초산부보다 태동을 빨리 느낀다고 조사되어 있습니다.','B18','B18','mother'),('p',277,'태동은 보통 초산부의 경우 임신 20주를 기준으로 ±2주경에 나타납니다. 처음 태동을 느끼는 순간은 기분이 매우 이상하여 드디어 임신했다는 사실이 실감 나면서 기쁨과 걱정이 교차하게 됩니다.','B18','B18','mother'),('p',278,'빠른 임신부는 태동을 느낍니다. 빠른 임신부는 배 안에서 무언가 꿈틀하는 태아의 움직임을 처음 느낄 수 있는데 이것이 태동입니다. ','B18','B18','mother'),('p',279,'아랫배 중간 지점에 임신 선이 나타납니다. 임신 선이라고 부르는 짙은 색 선이 아랫배 중간의 지점에 세로로 나타나고 때론 종아리 뒤에도 나타나기도 합니다.','B19','B19','mother'),('p',280,'태아가 커짐에 따라 자궁저의 높이는 14~18cm 정도가 됩니다. 자궁저는 커진 자궁의 가장 위쪽 끝을 가리키는 것으로 배꼽 부근까지 올라와 의사가 손으로 만져 보면서 진찰을 할 수 있을 정도가 됩니다.','B19','B19','mother'),('p',281,'임신 기간 중 모체가 가장 안정되는 시기입니다. 본격적인 안정기에 접어들며 체중 증가가 눈에 두드러지고 배가 눈에 띄게 나온 상태가 되어 임신부임을 감출 수 없는 상태가 됩니다. 유선이 발달하여 빠른 임신부의 경우 젖꼭지를 누르면 초유가 나오기도 합니다.','B20','B20','mother'),('p',282,'태아가 커져서 근육 덩어리인 자궁이 갑작스러운 증가에 수축하려는 성질을 보여 하루 4~6회 정도 배가 단단히 뭉치는 느낌을 받기도 합니다.','B20','B20','mother'),('p',283,'조금 가파른 길을 오르거나 계단을 오를 때 숨이 차오르지만 걱정할 일은 아닙니다. 자궁이 커지면서 폐를 압박하기 때문에 일어나는 일반적인 증상입니다. 시간이 흐르고 자궁이 더 커지면서 이러한 증상은 심해질 수도 있습니다. 체중관리를 잘해야 숨 가쁨을 조금이라도 줄일 수 있습니다.','B21','B21','mother'),('p',284,'\"임신 중반기에 접어들면서 임신부로서의 생활이 본격화 되었습니다. 문득문득 느껴지는 임신에 대한 두려움, 몸의 불편함이 임신 우울증을 발생하게 합니다.\"','B22','B22','mother'),('p',285,'임신부의 배꼽이 납작해지고 튀어나오게 됩니다. 출산 후 자연스레 원 상태를 회복하므로 걱정할 일은 아닙니다.','B23','B23','mother'),('p',286,'\"자궁이 커지면서 정맥을 압박하고, 엄마 몸의 혈액 순환이 하반신에 집중되면서 넓적 다리나 정강이 안쪽의 정맥이 퍼렇게 부풀어 튀어 오르는 현상을 정맥류라고 합니다. 큰 통증이 있거나 부작용은 아니지만 다리가 당기는 느낌이 들수 있습니다.\"','B23','B23','mother'),('p',287,'\"임신에 따른 증상들이 나타납니다. 몸이 붓기도 하고, 다리가아프기도 합니다.\"','B23','B23','mother'),('p',288,'평상시보다 땀을 많이 흘립니다. 몸이 무거워지는 탓도 있지만 갑상선이 임신중에는더욱 활발하게 활동하기 때문입니다. 조금만 운동을 해도 숨이차기도 합니다.','B24','B24','mother'),('p',289,'\"임신부는 배 엉덩이,가슴 부분에 흐릿한 붉은 임신선이 생깁니다. 아주 없앨 수는 없지만 젤이나 크림을 바르거나 임신부용 브래지어를 하여 가슴을 단단히 받쳐줌으로써 이 현상을 줄일 수는 있습니다. 출산 후 아주 흐리게 되거나 없어지므로 크게 걱정할 일은 아닙니다.\"','B25','B25','mother'),('p',290,'\"눈이 빚에 민감해지고 건조하면서 껄끄러운 느낌을 가질 수도 있습니다. 이것 역시 정상적인 증상이며, 인공눈물을 통해 이 현상을 줄일 수 있습니다.\"','B25','B25','mother'),('p',291,'예전의 검사에서 적혈구 부족이 나타났다면 지금 쯤 빈혈의 증상이 나타날 수도 있습니다. 대개의 임신부들은 임신 빈혈이 아니어도 몸의 변화에 따라 약간의 빈혈 증세가 있을 수 있습니다.','B26','B26','mother'),('p',292,'여자의 신체 구조는 방광염에 걸릴 확률을 높입니다.특히 임신 중에는방광염에 걸릴 확률이 높고 방광염은 조산 또는기형아의 가능성을 높입니다.','B26','B26','mother'),('p',293,'임신부의 혈압이 조금 높아지는 것은 정상입니다.','B27','B27','mother'),('p',294,'이제부터 임신 후기의 3개월이 시작 되었습니다. 이 임신 후기 동안 대부분의 임신부들은 8.5~10kg정도의 몸무게가 불어납니다.','B29','B29','mother'),('p',295,'\"임신 8개월 정도가 되면 아기에게는 필수적인 초유가 만들어집니다. 초유는 임신 7개월부터 산모의 유방에서 생산되어 아기 출생 후 5일 이내에 분비되는 모유입니다. 무척 진하고 끈끈하며 짙은 노란색을 띠고 양도 아주 적지만 단백질, 지용성 비타민 무기질 함량이 높아 아기에게 꼭 먹여야 합니다.\"','B29','B29','mother'),('p',296,'점차 태아가 아래로 내려가는 것을 느낄 수 있습니다. 아랫배 쪽으로 무게가 느껴지다가 아기가 밑으로 빠져나올 것 같은 느낌도 듭니다. 하지만 아기가 벌써 밑으로 내려오는 일은 없습니다. 걱정하지 마세요.','B30','B30','mother'),('p',297,'출산이 임박해져 아기가밑으로 내려가기 전까지 임신부는 숨이 가쁩니다. 자궁이 횡경막에 압력을 가할만큼 커졌기 때문입니다.','B31','B31','mother'),('p',298,'자궁의 근육이 예민해져 자궁 수축의 느낌이 느껴집니다. 배가 당기거나 조이는듯한 느낌이 들고 때로는 공처럼뭉치는것 같기도 합니다. 자궁 수축의 느낌이 느껴질 때는 무리한 외출이나 집안일을 하지 않고 배를 따뜻하게하거나 푹쉬세요. 자궁 수축이 자주 느껴지면 담당 의사 선생님과 상의하세요.','B31','B31','mother'),('p',299,'\"일주일에 400~450g정도 예비 엄마의 몸무게가 늘어나는데, 그 중의 반은 태아의 몸무게입니다.\"','B33','B33','mother'),('p',300,'자궁이 커져 위를 압박하면서 소화가 쉽지 않아 식사를 제대로 하지 못 할 수 있습니다. 조금씩 자주 식사하는 방법을 선택하세요. 특히 후기에 생기기 쉬운 임신 빈혈로 고생하지 않도록 철분 등 필요한 영양소 섭취를 위해 식사를 거르지 마세요.','B33','B33','mother'),('p',301,'\"보통 32~34주 즈음에는 초음파 검사를 합니다. 태아의 건강, 태아의발육, 태반의위치, 양수의 양등을 체크합니다\"','B33','B33','mother'),('p',302,'\"엄마의 골반 부분이 쑤시거나 마비되는것 같은 증상을 경험할 수 있습니다. 다리나 골반신경을 태아가 누르고 있기 때문입니다. 출산 때까지 계속될 수도 있는데, 많이 불편하면 의사와 상의하세요.\"','B35','B35','mother'),('p',303,'\"처음에 비해 엄마의 자궁은 1,000배나 커졌습니다. 커진 자궁은 갈비뼈 근처까지 와있고, 체중이 11~14kg 정도 증가하며 또한 배 전체를 차지한듯 불편한 느낌도 줍니다. 그러나 다행히도 대부분 더 이상 급격한 체중 증가는 나타나지 않습니다.\"','B36','B36','mother'),('p',304,'\"아랫배에 느껴지는 압력이 많아지고, 자꾸 아기가 아래로 내려오고 있다는 느낌이 들게 됩니다. 그와 함께 자궁이 커짐으로 인해 불편함을 느껴야 했던 예비 엄마는 폐와 위장 활동이 쉬워져 숨쉬기도 쉽고 소화도 잘 되는 것 같습니다.\"','B37','B37','mother'),('p',305,'산모는 걸어 다니는 일이 어렵고 걸음을 뗄 때마다 아기가 나올 것 같은 느낌이 들기도 합니다. 또 소변도 자주 마렵습니다.','B37','B37','mother'),('p',306,'임신 말기에는 심장 박동이 좀 더 빨라지면서 일반인보다 약 45% 이상의 피를 더 혈관으로 뿜어내게 됩니다.','B38','B38','mother'),('p',307,'지난 달에 비해 오히려 태동이 약해집니다. 태아가 점점 골반 쪽으로 내려오고 있기 때문입니다. 자연스런 현상이므로 약해지는 태동을 걱정할 필요는 없습니다.','B40','B39','mother'),('p',308,'\"심호흡을 자주 하고 식사하기가 불편해집니다. 자궁저부의 높이는 25~28cm, 배는 점점 더 커지며 자궁은 가슴뼈 7~8cm 아래까지 올라와 위가 압박되고 식사가 거북해집니다. \"','B31','B31','mother'),('p',309,'태동이 강해지고 숨이 차며 숨을 쉬어도 제대로 쉰 것 같지 않아 심호흡을 자주 하게 됩니다. 누워있으면 숨이 더 차게 되어 똑바로 눕지 못하는 경우가 많습니다.','B31','B31','mother'),('p',310,'자궁이 수축하여 하루에 4~5회 배가 똘똘 뭉치는 듯한 느낌이 듭니다.','B31','B31','mother'),('p',311,'임신부의 몸이 서서히 출산 준비에 들어가며 분비물도 늘어갑니다.','B31','B31','mother'),('p',312,'\"임신 호르몬이 골반 근처, 특히 엉덩이와 방광 앞에 있는 뼈의 관절을 늘어나게 하고 약하게 하여 척추주위의 인대나 근육을 쉽게 다치게 합니다.\"','B32','B32','mother'),('p',313,'\"리나 엉덩이, 방광 앞쪽 부위의 관절이 늘어나 있어 몸을 움직일 때 관절이 어긋나게 되어 ‘뚝뚝’ 소리가 나기도 하고 아픔을 느끼기도 합니다.\"','B32','B32','mother'),('p',314,'또 자궁이 갈비뼈 바로 아래 정도까지 올라와 위가 치밀라며 가슴이 답답해집니다. 마치 입덧을 하는 것처럼 속이 거북해집니다.','B32','B32','mother'),('p',315,'어깨로 숨을 쉰다는 말이 나올 정도로 힘들어지는 시기입니다. 모체는 자궁이 명치 가까이 육박하며 흉부쪽으로 압박하기 때문에 식사를 충분히 할 수 없게 되고 심장 압박으로 심장박동이 급해지며 숨도 매우 가빠집니다.','B33','B33','mother'),('p',316,'늘어난 자궁의 무게로 인해 골반 뼈의 연결된 부분인 치골도 아프고 변비와 치질이 생기기 쉬워집니다.','B33','B33','mother'),('p',317,'복부는 배꼽이 튀어나올 정도로 불룩해지고 배가 단단해지면서 소변보는 횟수도 늘어납니다.','B33','B33','mother'),('p',318,'분만에 가까워질수록 불규칙한 자궁수축이 잦아집니다.','B33','B33','mother'),('p',319,'요통이 심해지고 생활하기 힘들어집니다. 자궁저의 높이가 30cm 정도로 배가 커지면서 요통이 심해지고 행동은 더욱 굼떠집니다.','B34','B34','mother'),('p',320,'엉덩이와 골반이 불편하고 아프고 자궁이 방광을 압박해 배뇨 횟수가 늘어나며 소변을 본 뒤에도 방광에 소변이 남아 있는 것 같아 개운하지가 않습니다.','B34','B34','mother'),('p',321,'질 분비물이 더 진해지고 더 많은 점액이 들어있습니다.','B34','B34','mother'),('p',322,'발목과 발이 더 많이 붓고 손과 얼굴도 붓게 됩니다.','B34','B34','mother'),('p',323,'다리에 쥐가 나거나 통증이 생길 수 있고 자다가 다리에 경련이 오기도 합니다.','B34','B34','mother'),('p',324,'색소 침착이 심해져 흑색 선이 눈에 띄게 진해집니다.','B34','B34','mother'),('p',325,'\"식욕이 늘었다 줄었다 하고 두통, 어지럼증, 현기증 증세가 나타나기도 하는 등 불편함이 늘어갑니다.\"','B35','B35','mother'),('p',326,'\"코피와 코 막힘, 귀 막힘 증세가 나타나는 수도 있고 빈혈 증세가 나타날 수도 있습니다. 잇몸이 약해지면서 피가 나기도 합니다.\"','B35','B35','mother'),('p',327,'위가 편해지고 숨도 덜 차게 됩니다. 태아가 골반 속으로 내려감으로 눌려 있던 위가 편해져 숨도 덜 차고 식욕도 좋아집니다. 배가 커지면서 등이 당기고 부종이 생길 수 있습니다. ','B36','B36','mother'),('p',328,'아기가 쉽게 나올 수 있게 질이 부드러워집니다. 태아의 머리가 점점 내려가 소변이 자주 마렵고 복부가 당기는 느낌이 있습니다. ','B37','B37','mother'),('p',329,'태아의 움직임은 다소 적어지지만 힘찹니다. ','B37','B37','mother'),('p',330,'\"피부의 착색, 유방의 부푼 정도, 임신선 등이 가장 현저해지고 출산을 위해 산도는 부드러워집니다. 아기가 쉽게 나올 수 있게 자궁구가 축축해지면서 유연해지고 탄력성이 생깁니다.\"','B37','B37','mother'),('p',331,'대부분 태아는 머리를 아래로 향한 위치가 고정되며 머리 부분이 모체의 골반 안으로 들어가 태동이 둔해집니다. 이로 인해 위의 압박감이나 답답함이 한결 덜해집니다. 그러나 배가 점점 무거워져 움직이거나 잠을 잘 때도 힘이 듭니다.','B38','B38','mother'),('p',332,'배가 당기는 증상이 자주 나타납니다. 태아가 언제든지 나올 수 있는 상태가 됩니다. 아기가 커짐에 따라 뱃가죽은 더욱 팽팽하게 퍼져서 배꼽의 패인 부분이 드러나지 않게 됩니다. ','B39','B39','mother');
/*!40000 ALTER TABLE `info` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `member`
--

DROP TABLE IF EXISTS `member`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `member` (
  `family_num` bigint DEFAULT NULL,
  `join_date` datetime(6) DEFAULT NULL,
  `num` bigint NOT NULL AUTO_INCREMENT,
  `email` varchar(255) DEFAULT NULL,
  `fcm_token` varchar(255) DEFAULT NULL,
  `member_id` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `profile_image` varchar(255) DEFAULT NULL,
  `parent_type` enum('MOTHER','FATHER') DEFAULT NULL,
  `platform` enum('NONE','KAKAO','NAVER','GOOGLE') DEFAULT NULL,
